data.value:
1. Select an entry in the table;
2. Click on the "Log'n'pass" button (Ctrl+D);
3. Go to authorization form (for example: authorization on the website in the browser, credentials entry in the mail client);
4. Select the "username" field and press Ctrl+V;
5. Then select the "password" field and press Ctrl+V;
6. Done.
